import React from "react";
import {BrowserRouter, Routes, Route} from "react-router-dom";

import "./components/styles/main.css";
import Good from "./pages/Good";
import Main from "./pages/Main";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/main" element={<Main />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
